import { Table } from 'antd';
import 'antd/dist/antd.css';
import React, { Component } from 'react';
import './index.css';

const columns = [
    { title: 'Server ID', dataIndex: 'record.serverID._text', key: 'serverID._text' },
    { title: 'Server URL', dataIndex: 'serverUrl._text', key: 'serverID._text' },
    { title: 'Online', dataIndex: 'online._text', key: 'online', key: 'serverID._text' },
    { title: 'Load Multiplier', dataIndex: 'loadMultiplier._text', key: 'serverID._text' },
    { title: 'Enabled', dataIndex: 'enabled._text', key: 'serverID._text' },
    { title: 'Load', dataIndex: 'load._text', key: 'serverID._text' },
    {
        title: 'Action',
        dataIndex: '',
        key: 'x',
        render: () => <a onClick={() => console.log("delete")}>Enable</a>
    },
];

class AntdTable extends Component {
    render() {
        return (
            <Table
                columns={columns}
                expandable={{
                    expandedRowRender: record => <p style={{ margin: 0 }}>{record.serverID._text}</p>,
                    rowExpandable: record => record.name !== 'Not Expandable',
                }}
                dataSource={this.props.children}
            />
        )
    }
}

export default (AntdTable);
